	public static String octToBin(String valOctale){
        if (valOctale.length()!=15) return "unknown";
        String res="";
        for(int i=0;i<14;i++){
            String oct=String.valueOf(valOctale.charAt(i));
            if(oct.equals("7")){res+=("nnn");}
            else if(oct.equals("6")){res+=("nno");}
            else if(oct.equals("5")){res+=("non");} 
            else if(oct.equals("4")){res+=("noo");} 
            else if(oct.equals("3")){res+=("onn");} 
            else if(oct.equals("2")){res+=("ono");} 
            else if(oct.equals("1")){res+=("oon");} 
            else if(oct.equals("0")){res+=("ooo");} 
            else{ res+=("?");}
        }
        String last=(String.valueOf(valOctale.charAt(14)));
        String c="";
        if (last.equals("0")) c="o";
        else if (last.equals("1")) c="n";
        else c="?";
        res+=c;
        return res;
    }
    
    public static String binToOct(String valBinaire) throws Exception{
        valBinaire.toLowerCase();
        String oct="";
        for(int i=0;i<14;i++){
            String bin=valBinaire.substring(i*3,(i*3+3));
            if (bin.equals("111") || bin.equals("nnn")) oct+="7";
            else if(bin.equals("110") || bin.equals("nno")) oct+="6" ;
            else if(bin.equals("101") || bin.equals("non")) oct+="5";
            else if(bin.equals("100") || bin.equals("noo")) oct+="4";
            else if(bin.equals("011") || bin.equals("onn")) oct+="3";
            else if(bin.equals("010") || bin.equals("ono")) oct+="2";
            else if(bin.equals("001") || bin.equals("oon")) oct+="1";
            else if(bin.equals("000") || bin.equals("ooo")) oct+="0";
            else if(bin.equals("...")) oct+="[0-7]";
            else if(bin.equals("1..") || bin.equals("n..")) oct+="[4-7]";
            else if(bin.equals(".1.") || bin.equals(".n.")) oct+="[2357]"; // oct+="[2-3]" replaced by oct+="[2357]"
            else if(bin.equals("..1") || bin.equals("..n")) oct+="[1357]"; // oct+="[1347]" replaced by oct+="[1357]"
            else if(bin.equals("0..") || bin.equals("o..")) oct+="[0-3]";
            else if(bin.equals(".0.") || bin.equals(".o.")) oct+="[0145]";
            else if(bin.equals("..0") || bin.equals("..o")) oct+="[0246]";
            else if(bin.equals("11.") || bin.equals("nn.")) oct+="[67]";
            else if(bin.equals("1.1") || bin.equals("n.n")) oct+="[57]";
            else if(bin.equals(".11") || bin.equals(".nn")) oct+="[37]";
            else if(bin.equals("00.") || bin.equals("oo.")) oct+="[01]";
            else if(bin.equals("0.0") || bin.equals("o.o")) oct+="[02]";
            else if(bin.equals(".00") || bin.equals(".oo")) oct+="[04]";
            else if(bin.equals("01.") || bin.equals("on.")) oct+="[23]";
            else if(bin.equals("0.1") || bin.equals("o.n")) oct+="[13]";
            else if(bin.equals(".01") || bin.equals(".on")) oct+="[15]";
            else if(bin.equals("10.") || bin.equals("no.")) oct+="[45]";
            else if(bin.equals("1.0") || bin.equals("n.o")) oct+="[46]";
            else if(bin.equals(".10") || bin.equals(".no")) oct+="[26]";
            
            else throw new Exception("This spoligotype can not be converted to an octal value");
        }
        char last=valBinaire.charAt(42);
        if(last=='1' || last=='n') oct+=1;
        else if(last=='0' || last =='o') oct+=0;
        else if(last=='.') oct+=".";
        else throw new Exception("This spoligotype can not be converted to an octal value");
        return oct;
    }
    
